INSERT INTO `movies` (`movie_id`, `title`, `genre`, `showdate`, `showtime`, `release_year`, `description`, `running_time`, `director`, `price`, `photo`, `trailer`, `delete_movie`) VALUES
(1, 'Army of the Dead', 'Action', '2021-04-06', '10:00 AM - 12:00 PM', '2021', 'Following a zombie outbreak in Las Vegas, a group of mercenaries take the ultimate gamble, venturing into the quarantine zone to pull off the greatest heist ever attempted.', 120, 'Zack Snyder', 500, '30-p_action_ArmyOfTheDead.jpg', '30-t_action_Army.mp4', 0),
(2, 'Radhe', 'Action', '2021-12-03', '10:00 AM - 12:00 PM', '2021', 'After taking the dreaded gangster Gani Bhai, ACP Rajveer Shikawat aka Radhe goes on a manhunt to find the wealthiest man of the town secretly running a crime syndicate.', 130, ' Prabhu Deva', 500, '32-p_action_Radhe.jpg', '32-t_action_Radhe.mp4', 0),
(3, 'Spider-Man: No Way Home', 'Action', '2021-04-04', '06:00 PM - 08:00 PM', '2021', 'A continuation of Spider-Man Far From Home', 180, 'Jon Watts', 500, '33-p_action_SpiderMan.jpg', '33-t_action_SpiderMan.mp4', 0),
(4, 'The New Mutants ', 'Action', '2021-04-05', '10:00 AM - 12:00 PM', '2021', 'Five young mutants, just discovering their abilities while held in a secret facility against their will, fight to escape their past sins and save themselves.', 180, ' Josh Boone', 500, '34-p_action_TheNewMutants.jpg', '34-t_action_TheNewMutants.mp4', 0),
(5, 'Shadow in the Cloud', 'Action', '2021-04-06', '06:00 PM - 08:00 PM', '2021', 'A female WWII pilot traveling with top secret documents on a B-17 Flying Fortress encounters an evil presence on board the flight.', 83, 'Roseanne Liang', 400, '35-p_action_ShadowInTheCloud.jpg', '35-t_action_Shadow in the cloud.mp4', 0),
(6, 'Coming to America 2', 'Comedy', '2021-04-06', '12:00 AM - 02:00 PM', '2021', 'The African monarch Akeem learns he has a long-lost son in the United States and must return to America to meet this unexpected heir and build a relationship with his son.', 120, 'Craig Brewer', 500, '40-comingtoamerica.jpg', '40-comingtoamerica.mp4', 0),
(7, 'I Care A Lot', 'Comedy', '2021-04-05', '12:00 PM - 02:00 PM', '2021', 'A crooked legal guardian who drains the savings of her elderly wards meets her match when a woman she tries to swindle turns out to be more than she first appears.', 118, 'J Blakeson', 500, '41-icarealot.jpg', '41-icarealot.mp4', 0),
(8, 'Thunder Force', 'Comedy', '2021-04-04', '04:00 PM - 06:00 PM', '2021', 'In a world where supervillains are commonplace, two estranged childhood best friends reunite after one devises a treatment that gives them powers to protect their city.', 120, 'Ben Falcone', 500, '42-thunderforce.jpg', '42-thunderforce.mp4', 0),
(9, 'Palm Spring', 'Comedy', '2021-04-05', '08:00 PM - 10:00 PM', '2020', 'Stuck in a time loop, two wedding guests develop a budding romance while living the same day over and over again.', 90, ' Max Barbakow', 400, '43-palmspring.jpg', '43-palmspring.mp4', 0),
(10, 'Emma', 'Comedy', '2021-04-07', '02:00 PM - 04:00 PM', '2020', 'In 1800s England, a well meaning but selfish young woman meddles in the love lives of her friends.', 132, 'Autumn de Wilde', 400, '44-emma.jpg', '44-emma.mp4', 0),
(11, 'The Map of Tiny Perfect Things', 'Comedy', '2021-04-07', '06:00 PM - 08:00 PM', '2021', 'Two teens who live the same day repeatedly, enabling them to create the titular map.', 99, ' Ian Samuels', 500, '45-themap.jpg', '45-themap.mp4', 0),
(12, 'Crazy About Her ', 'Comedy', '2021-04-07', '10:00 AM - 12:00 PM', '2021', 'After a magical night together, Adri voluntarily turns himself into the psychiatric institution where Carla lives.', 102, 'Dani de la Orden', 500, '46-crazyabouther.jpg', '46-crazyabouther.mp4', 0),
(13, 'Cruella', 'Comedy', '2021-04-07', '12:00 PM - 02:00 PM', '2021', 'A live-action prequel feature film following a young Cruella de Vil.', 120, 'Craig Gillespie', 500, '47-cruella.jpg', '47-cruella.mp4', 0),
(14, 'Promising Young Woman', 'Crime', '2021-12-25', '04:00 PM - 06:00 PM', '2020', 'A young woman, traumatized by a tragic event in her past, seeks out vengeance against those who crossed her path.', 114, 'Promising Young Woman', 400, '48-promisingyoungwoman.jpg', '48-promisingyoungwoman.mp4', 0),
(15, 'Capone', 'Crime', '2021-05-25', '06:00 PM - 08:00 PM', '2020', 'The 47-year old Al Capone, after 10 years in prison, starts suffering from dementia and comes to be haunted by his violent past.', 104, 'Josh Trank', 400, '49-capone.jpg', '49-capone.mp4', 0),
(16, 'Adverse', 'Crime', '2021-04-03', '08:00 PM - 10:00 PM', '2021', 'A rideshare driver discovers that his sister is in debt to a dangerous crime syndicate.', 94, 'Brian A. Metcalf', 500, '50-adverse.jpg', '50-adverse.mp4', 0),
(17, 'The Devil All the Time', 'Crime', '2021-09-16', '10:00 AM - 12:00 PM', '2020', 'Sinister characters converge around a young man devoted to protecting those he loves in a postwar backwoods town teeming with corruption and brutality.', 139, 'Antonio Campos', 400, '51-thedevil.jpg', '51-thedevilallthetime.mp4', 0),
(18, 'Birds of Prey', 'Crime', '2021-04-08', '12:00 PM - 02:00 PM', '2020', 'After splitting with the Joker, Harley Quinn joins superheroes Black Canary, Huntress and Renee Montoya to save a young girl from an evil crime lord.', 109, 'Cathy Yan', 400, '52-birdsofprey.jpg', '52-birdsofprey.mp4', 0),
(19, 'The Little Things', 'Crime', '2021-04-08', '02:00 PM - 04:00 PM', '2021', 'Kern County Deputy Sheriff Joe Deacon is sent to Los Angeles for what should have been a quick evidence-gathering assignment. Instead, he becomes embroiled in the search for a serial killer who is terrorizing the city.', 128, 'John Lee Hancock', 500, '53-thelittlethings.jpg', '53-thelittlethings.mp4', 0),
(20, 'Cherry', 'Crime', '2021-04-08', '04:00 PM - 06:00 PM', '2021', 'An Army medic suffering from post-traumatic stress disorder becomes a serial bank robber after an addiction to drugs puts him in debt.', 120, 'Anthony Russo, Joe Russo', 500, '54-cherry.jpg', '54-cherry.mp4', 0),
(21, 'Girl in the Basement', 'Crime', '2021-04-08', '06:00 PM - 08:00 PM', '2021', 'Sara is a teen girl who is looking forward to her 18th birthday to move away from her controlling father Don. But before she could even blow out the candles, Don imprisons her in the basement of their home.', 90, 'Elisabeth Röhm', 500, '55-girlinthebasement.jpg', '55-girlinthebasement.mp4', 0),
(22, 'Nobody', 'Crime', '2021-04-08', '10:00 AM - 12:00 PM', '2021', 'A bystander who intervenes to help a woman being harassed by a group of men becomes the target of a vengeful drug lord.', 120, 'Ilya Naishuller', 500, '56-nobody.jpg', '56-nobody.mp4', 0),
(23, 'Nomadland', 'Drama', '2021-04-09', '12:00 PM - 02:00 PM', '2021', 'After losing everything in the Great Recession, a woman embarks on a journey through the American West, living as a van-dwelling modern-day nomad.', 110, 'Chloé Zhao', 500, '57-nomadland.jpg', '57-nomadland.mp4', 0),
(24, 'News of the World ', 'Drama', '2021-04-09', '04:00 PM - 06:00 PM', '2020', 'A Civil War veteran agrees to deliver a girl, taken by the Kiowa people years ago, to her aunt and uncle, against her will. They travel hundreds of miles and face grave dangers as they search for a place that either can call home.', 118, 'Paul Greengrass', 400, '58-thenews.jpg', '58-newsoftheworld.mp4', 0),
(25, 'The World to Come', 'Drama', '2021-04-09', '06:00 PM - 08:00 PM', '2021', 'Somewhere along the mid-19th century American East Coast frontier, two neighboring couples battle hardship and isolation, witnessed by a splendid yet testing landscape, challenging them both physically and psychologically.', 105, 'Mona Fastvold', 500, '59-theworldtocome.jpg', '59-theworldtocome.mp4', 0),
(26, 'The Dig', 'Drama', '2021-04-03', '10:00 AM - 12:00 PM', '2021', 'An archaeologist embarks on the historically important excavation of Sutton Hoo in 1938.', 112, 'Simon Stone', 500, '60-thedig.jpg', '60-thedig.mp4', 0),
(27, 'Eternals', 'Drama', '2021-11-05', '12:00 PM - 02:00 PM', '2021', 'The saga of the Eternals, a race of immortal beings who lived on Earth and shaped its history and civilizations.', 120, 'Chloé Zhao', 500, '61-eternals.jpg', '61-eternals.mp4', 0),
(28, 'Wonder Woman 1984', 'Fantasy', '2021-12-25', '04:00 PM - 06:00 PM', '2020', 'Diana must contend with a work colleague and businessman, whose desire for extreme wealth sends the world down a path of destruction, after an ancient artifact that grants wishes goes missing.', 91, 'Patty Jenkins', 400, '62-wonderwoman.jpg', '62-wonderwoman.mp4', 0),
(29, 'The Witches', 'Fantasy', '2021-10-22', '06:00 PM - 08:00 PM', '2020', 'A young boy and his grandmother have a run-in with a coven of witches and their leader.', 101, ' Robert Zemeckis', 500, '63-thewitches.jpg', '63-thewitches.mp4', 0),
(30, 'Love and Monsters', 'Fantasy', '2021-10-16', '08:00 PM - 10:00 PM', '2020', 'In a monster-infested world, Joel learns his girlfriend is just 85 miles away. To make the dangerous journey, Joel discovers his inner hero to be with the girl of his dreams.', 109, 'Michael Matthews', 400, '64-loveandmonsters.jpg', '64-loveandmonster.mp4', 0),
(31, 'Dolittle', 'Fantasy', '2021-04-11', '10:00 AM - 12:00 PM', '2020', 'A physician who can talk to animals embarks on an adventure to find a legendary island with a young apprentice and a crew of strange pets.', 101, 'Stephen Gaghan', 500, '65-dolittle.jpg', '65-dolittle.mp4', 0),
(32, 'Outside the Wire', 'Fantasy', '2021-04-11', '12:00 PM - 02:00 PM', '2021', 'In the near future, a drone pilot sent into a war zone finds himself paired with a top-secret android officer on a mission to stop a nuclear attack.', 114, 'Mikael Håfström', 500, '66-outsidethewire.jpg', '66-outsidethewire.mp4', 0),
(33, 'Ghostbusters: Afterlife', 'Fantasy', '2021-11-21', '08:00 PM - 10:00 PM', '2021', 'When a single mom and her two kids arrive in a small town, they begin to discover their connection to the original Ghostbusters and the secret legacy their grandfather left behind.', 120, 'Jason Reitman', 500, '68-ghostbuster.jpg', '68-ghostbuster.mp4', 0),
(34, 'Cinderella', 'Fantasy', '2021-07-16', '04:00 PM - 06:00 PM', '2021', 'A modern musical version of the classic fairy tale \"Cinderella\".', 120, 'Kay Cannon', 400, '69-cinderella.jpg', '69-cinderella.mp4', 0),
(35, 'Freaky', 'Horror', '2021-11-13', '10:00 AM - 12:00 PM', '2020', 'After swapping bodies with a deranged serial killer, a young girl in high school discovers she has less than 24 hours before the change becomes permanent.', 102, 'Christopher Landon', 400, '70-freaky.jpg', '70-freaky.mp4', 0),
(36, 'His House', 'Horror', '2021-10-30', '02:00 PM - 04:00 PM', '2020', 'A refugee couple makes a harrowing escape from war-torn South Sudan, but then they struggle to adjust to their new life in an English town that has an evil lurking beneath the surface.', 93, 'Remi Weekes', 400, '71-hishouse.jpg', '71-hishouse.mp4', 0),
(37, 'The Call', 'Horror', '2021-11-27', '08:00 PM - 10:00 PM', '2020', 'Two people live in different times. Seo-Yeon lives in the present and Young-Sook lives in the past. One phone call connects the two, and their lives are changed irrevocably.', 112, 'Chung-Hyun Lee', 400, '72-thecall.jpg', '72-thecall.mp4', 0),
(38, 'No Escape ', 'Horror', '2021-09-18', '06:00 PM - 08:00 PM', '2020', 'A social media personality travels with his friends to Moscow to capture new content for his successful VLOG. Always pushing the limits and catering to a growing audience, they enter a cold world of mystery, excess, and danger.', 91, 'Will Wernick', 400, '73-noescape.jpg', '73-noescape.mp4', 0),
(39, 'Candyman', 'Horror', '2021-08-27', '02:00 PM - 04:00 PM', '2021', 'A \"spiritual sequel\" to the horror film Candyman (1992) that returns to the now-gentrified Chicago neighborhood where the legend began.', 120, 'Nia DaCosta', 500, '74-candyman.jpg', '74-candyman.mp4', 0),
(40, 'The Green Knight', 'Horror', '2021-07-30', '02:00 PM - 04:00 PM', '2021', 'A fantasy re-telling of the medieval story of Sir Gawain and the Green Knight.', 120, 'David Lowery', 500, '75-thegreenkngiht.jpg', '75-thegreenknight.mp4', 0),
(41, 'The Seventh Day', 'Horror', '2021-04-12', '04:00 PM - 06:00 PM', '2021', 'A renowned exorcist who teams up with a rookie priest for his first day of training. As they plunge deeper into hell on earth, the lines between good and evil blur, and their own demons emerge.', 87, 'Justin P. Lange', 500, '76-theseventhday.jpg', '76-theseventhday.mp4', 0),
(42, 'Life in a Year', 'Romance', '2021-11-27', '12:00 PM - 02:00 PM', '2020', 'The movie follows 17-year-old Daryn who finds out that his girlfriend is dying. He sets out to give her an entire life in the last year she has left.', 107, 'Mitja Okorn', 400, '77-lifeinayear.jpg', '77-lifeinayear.mp4', 0),
(43, 'The Broken Hearts Gallery', 'Romance', '2021-09-11', '02:00 PM - 04:00 PM', '2020', 'After a break-up, a young woman decides to start a gallery where people can leave trinkets from past relationships.', 109, ' Natalie Krinsky', 400, '78-thebrokenheart.jpg', '78-thebrokenhearts.mp4', 0),
(44, 'Wicked', 'Romance', '2021-12-22', '04:00 PM - 06:00 PM', '2021', 'The story of how a green-skinned woman framed by the Wizard of Oz becomes the Wicked Witch of the West; feature film based on the Broadway musical.', 120, 'Jon M. Chu', 500, '79-wicked.jpg', '79-wicked.mp4', 0),
(45, 'Reminiscence', 'Romance', '2021-09-03', '06:00 PM - 08:00 PM', '2021', 'A scientist discovers a way to relive your past and uses the technology to search for his long lost love.', 120, 'Lisa Joy', 500, '80-reminiscence.jpg', '80-reminiscence.mp4', 0),
(46, 'Bloodshot', 'Fiction', '2021-04-12', '10:00 AM - 12:00 PM', '2020', 'Ray Garrison, a slain soldier, is re-animated with superpowers.', 109, 'Dave Wilson', 400, '81-bloodshot.jpg', '81-bloodshot.mp4', 0),
(47, 'Midnight sky', 'Fiction', '2021-12-23', '12:00 PM - 02:00 PM', '2020', 'This post-apocalyptic tale follows Augustine, a lonely scientist in the Arctic, as he races to stop Sully and her fellow astronauts from returning home to a mysterious global catastrophe.', 118, ' George Clooney', 400, '82-midnightsky.jpg', '82-midnightsky.mp4', 0),
(48, 'Archive', 'Fiction', '2021-07-10', '02:00 PM - 04:00 PM', '2020', '2038: George Almore is working on a true human-equivalent AI. His latest prototype is almost ready. This sensitive phase is also the riskiest. Especially as he has a goal that must be hidden at all costs.', 109, 'Gavin Rothery', 400, '83-archive.jpg', '83-archive.mp4', 0),
(49, 'The Last Day of American Crime', 'Fiction', '2021-06-20', '04:00 PM - 06:00 PM', '2020', 'In the not-too-distant future, as a final response to terrorism and crime, the U.S. government plans to broadcast a signal making it impossible for anyone to knowingly commit unlawful acts.', 148, 'Olivier Megaton', 400, '84-thelastdays.jpg', '84-lastday.mp4', 0),
(50, 'The Tomorrow War', 'Fiction', '2021-07-23', '06:00 PM - 08:00 PM', '2021', 'A man is drafted to fight in a future war where the fate of humanity relies on his ability to confront his past.', 120, 'Chris McKay', 500, '85-tomorrowwar.jpg', '85-tomorrowwar.mp4', 0),
(51, 'Oxygene', 'Fiction', '2021-05-12', '08:00 PM - 10:00 PM', '2021', 'A woman wakes in a cryogenic chamber with no recollection of how she got there, and must find a way out before running out of air.', 120, 'Alexandre Aja', 500, '86-oxygene.jpg', '86-oxygen.mp4', 0),
(52, 'Ascendant', 'Fiction', '2021-04-28', '10:00 AM - 12:00 PM', '2021', 'A young environmentalist wakes, trapped, kidnapped in the elevator of a super high-rise building at the mercy of her tormentors', 120, ' Antaine Furlong', 500, '87-ascendant_fiction.jpg', '87-ascendant.mp4', 0),
(53, 'A Quiet Place Part II', 'Fiction', '2021-05-28', '12:00 PM - 02:00 PM', '2021', 'Following the events at home, the Abbott family now face the terrors of the outside world. Forced to venture into the unknown, they realize the creatures that hunt by sound are not the only threats lurking beyond the sand path.', 97, 'John Krasinski', 500, '88-aquietplace.jpg', '88-quietplace.mp4', 0),
(54, 'Cube', 'Fiction', '2021-10-22', '02:00 PM - 04:00 PM', '2021', 'In the remake of the Canadian film, six males and females of varying ages and backgrounds find themselves locked and confined in a mysterious cube shaped room.', 120, 'Yasuhiko Shimizu', 500, '89-cube.jpg', '89-cube.mp4', 0),
(55, 'Moxie ', 'Comedy', '2021-04-04', '08:00 PM - 10:00 PM', '2021', 'Fed up with the sexist and toxic status quo at her high school, a shy 16-year-old finds inspiration from the rebellious past of her mother and anonymously publishes a zine that sparks a school-wide, coming-of-rage revolution.', 120, 'Amy Poehler', 500, 'moxie.jpg', 'moxie.mp4', 0),
(56, 'Mank ', 'Comedy', '2021-12-04', '02:00 PM - 04:00 PM', '2020', '1930s, Hollywood is reevaluated through the eyes of scathing social critic and alcoholic screenwriter Herman J. Mankiewicz as he races to finish the screenplay of Citizen Kane (1941).', 120, 'David Fincher', 400, 'mank.jpg', 'mank.mp4', 0),
(57, 'Minari', 'Drama', '2021-04-13', '08:00 PM - 10:00 PM', '2021', 'A Korean family starts a farm in 1980s Arkansas.', 115, 'Lee Isaac Chung', 400, 'minari.jpg', 'minari.mp4', 0),
(58, 'Music', 'Drama', '2021-04-21', '12:00 PM - 02:00 PM', '2021', 'Zu is newly sober when she receives news that she is to become the sole guardian of her half-sister named Music, a young girl on the autism spectrum. The film explores two favorite themes of Sia: finding your voice and creating family.', 107, 'Sia', 500, 'music.jpg', 'music.mp4', 0),
(59, 'Dune', 'Drama', '2021-10-01', '06:00 PM - 08:00 PM', '2021', 'Feature adaptation of  science fiction novel by Frank Herbert, about the son of a noble family entrusted with the protection of the most valuable asset and most vital element in the galaxy.', 120, 'Denis Villeneuve', 500, 'dune.jpg', 'dune.mp4', 0),
(60, 'Fear of Rain', 'Drama', '2021-04-29', '04:00 PM - 06:00 PM', '2021', 'A girl living with schizophrenia struggles with terrifying hallucinations as she begins to suspect her neighbor has kidnapped a child. The only person who believes her is Caleb -a boy she is not even sure exists.', 109, 'Castille Landon', 500, 'fearofrain.jpg', 'fearofrain.mp4', 0),
(61, 'Blithe Spirit', 'Fantasy', '2021-04-14', '10:00 AM - 12:00 PM', '2021', 'A spiritualist medium holds a seance for a writer suffering from creative block but accidentally summons the spirit of his deceased first wife, which leads to an increasingly complex love triangle with his current wife of five years.', 99, 'Edward Hall', 500, 'blithe.jpg', 'blithe.mp4', 0),
(62, 'Cinderella', 'Fantasy', '2021-07-16', '10:00 AM - 12:00 PM', '2021', 'A modern musical version of the classic fairy tale, Cinderella.', 120, 'Kay Cannon', 400, 'cinderella.jpg', 'cinderella.mp4', 0),
(63, 'Jungle Cruise', 'Fantasy', '2021-07-30', '12:00 PM - 02:00 PM', '2021', 'Based on the theme park ride of Disneyland where a small riverboat takes a group of travelers through a jungle filled with dangerous animals and reptiles but with a supernatural element.', 120, 'Jaume Collet-Serra', 500, 'junglecruise.jpg', 'juniorcruise.mp4', 0),
(64, 'Sputnik', 'Horror', '2021-07-24', '02:00 PM - 04:00 PM', '2020', 'The lone survivor of an enigmatic spaceship incident has not returned back home alone-hiding inside his body is a dangerous creature.', 113, 'Egor Abramenko', 400, 'sputnik.jpg', 'sputnik.mp4', 0),
(65, 'Wrong Turn', 'Horror', '2021-04-15', '04:00 PM - 06:00 PM', '2021', 'Friends hiking the Appalachian Trail are confronted by The Foundation, a community of people who have lived in the mountains for hundreds of years.', 109, 'Mike P. Nelson', 500, 'wrongturn.jpg', 'wrongturn.mp4', 0),
(66, 'The Forever Purge', 'Horror', '2021-07-19', '06:00 PM - 08:00 PM', '2021', 'Plot unknown. The fifth and final installment of The Purge film series.', 120, 'Everardo Gout', 500, 'foreverpurge.jpg', 'theforevepurge.mp4', 0),
(67, 'Holidate', 'Romance', '2021-10-20', '08:00 PM - 10:00 PM', '2020', 'Fed up with being single on holidays, two strangers agree to be each other is platonic plus-ones all year long, only to catch real feelings along the way.', 104, 'John Whitesell', 400, 'holidate.jpg', 'holidate.mp4', 0),
(68, 'In the Heights', 'Romance', '2021-06-18', '10:00 AM - 12:00 PM', '2021', 'A feature version of the Broadway musical, in which a bodega owner has mixed feelings about closing his store and retiring to the Dominican Republic after inheriting the fortune of his grandmother', 120, 'Jon M. Chu', 500, 'intheheights.jpg', 'intheheight.mp4', 0),
(69, 'Shang-Chi and the Legend of the Ten Rings ', 'Fantasy', '2021-07-09', '06:00 PM - 08:00 PM', '2021', 'The movie, based on Marvel Comics, will focus on Shang-Chi called The Master of Kung-Fu.', 120, 'Destin Daniel Cretton', 500, 'shangchi.jpg', 'shangchi.mp4', 0),
(70, 'To All the Boys: P.S. I Still Love You', 'Romance', '2021-11-26', '06:00 PM - 08:00 PM', '2020', 'Lara Jean and Peter have just taken their relationship from pretend to officially official when another recipient of one of her old love letters enters the picture.', 101, 'Michael Fimognari', 500, 'toalltheboys.jpg', 'toalltheboys.mp4', 0),
(71, 'Ninnila Ninnila', 'Romance', '2021-04-16', '08:00 PM - 10:00 PM', '2021', 'In London, Dev, an overweight, genius chef who suffers with muscle spasms, meets Tara and love blossoms, but things take an interesting turn when he crosses paths with Maya.', 118, 'Ani. I.V. Sasi', 500, 'ninnila.jpg', 'ninnila.mp4', 0),
(72, 'Happily', 'Romance', '2021-04-18', '12:00 PM - 02:00 PM', '2021', 'A dark romantic comedy. Tom and Janet have been happily married for years. But a visit from a mysterious stranger leads to a dead body, a lot of questions, and a tense trip of couples with friends who may not actually be friends at all.', 96, 'BenDavid Grabinski', 500, 'happily.jpg', 'happily.mp4', 0),
(73, 'The invisible man', 'Fiction', '2021-04-05', '08:00 PM - 10:00 PM', '2020', 'When the abusive ex of Cecilia takes his own life and leaves her his fortune, she suspects his death was a hoax. As a series of coincidences turn lethal, Cecilia works to prove that she is being hunted by someone nobody can see.', 120, 'Leigh Whannell', 400, 'theinvisibleman.jpg', 'invisibleman.mp4', 0),
(74, 'The Trial of the Chicago 7 ', 'Drama', '2021-10-12', '08:00 PM - 10:00 PM', '2020', 'The story of 7 people on trial stemming from various charges surrounding the uprising at the 1968 Democratic National Convention in Chicago, Illinois.', 120, 'Aaron Sorkin', 400, 'thetrial.jpg', 'thetrial.mp4', 0),
(75, 'Super Intelligence', 'Romance', '2021-11-26', '06:00 PM - 08:00 PM', '2020', 'When an all-powerful Superintelligence chooses to study average Carol Peters, the fate of the world hangs in the balance. As the A.I. decides to enslave, save or destroy humanity, it is up to Carol to prove that people are worth saving.', 106, 'Ben Falcone', 400, 'superintelligence.jpg', 'superintelligence.mp4', 0),
(76, 'Mortal Kombat', 'Action', '2021-04-30', '12:00 PM - 02:00 PM', '2021', 'MMA fighter Cole Young seeks out greatest champions of the Earth in order to stand against the enemies of Outworld in a high stakes battle for the universe.', 120, 'Simon McQuoid', 500, 'p_action_MortalKombat.jpg', 't_action_MortalKombat.mp4', 0),
(77, 'The Silencing ', 'Action', '2021-04-30', '02:00 PM - 04:00 PM', '2021', 'A reformed hunter living in isolation on a wildlife sanctuary becomes involved in a deadly game of cat and mouse when he and the local Sheriff set out to track a vicious killer who may have kidnapped his daughter years ago.', 120, 'Robin Pront', 500, 'p_action_TheSilencing.jpg', 't_action_TheSilencing.mp4', 0),
(78, 'The Hunt', 'Action', '2021-04-30', '04:00 PM - 06:00 PM', '2020', 'Twelve strangers wake up in a clearing. They do not know where they are, or how they got there. They do not know they have been chosen - for a very specific purpose - The Hunt.', 90, ' Craig Zobel', 400, 'p_action_TheHunt.jpg', 't_action_TheHunt.mp4', 0),
(79, 'Enola Holmes', 'Action', '2021-04-30', '06:00 PM - 08:00 PM', '2020', 'When Enola Holmes-teen sister of Sherlock-discovers her mother missing, she sets off to find her, becoming a super-sleuth in her own right as she outwits her famous brother and unravels a dangerous conspiracy around a mysterious young Lord.', 110, 'Harry Bradbeer', 400, 'e.jpg', 'e.mp4', 0),
(80, 'Without Remorse', 'Action', '2021-04-30', '08:00 PM - 10:00 PM', '2021', 'John Clark, a Navy SEAL, goes on a path to avenge the murder of his wife only to find himself inside of a larger conspiracy.', 120, 'Stefano Sollima', 500, 'p_action_TomClancy.jpg', 't_action_TomClancy.mp4', 0);
